import './App.css';
import {useState} from 'react';
import {Link} from 'react-router-dom';

function PickLeagues(props) {

  return (

    <div>
      <h2>Pick Your Leagues {props.email}</h2>




      <Link to="./PickTeams">
        <button className="btn btn-dark">Next</button>
      </Link>
    </div>
  );
}

export default PickLeagues();
